import {JeecgListMixin} from "../../../mixins/JeecgListMixin2";
import nextUsers from './nextUsers'
import {getAction, postAction} from '@/api/manage'


export default {
  name: "reCallModal",
  mixins: [JeecgListMixin],
  components: {
    nextUsers
  },
  data() {
    return {
      title: '撤回',
      taskMsg: '',
      visible: false,
      confirmLoading: false,
      columns: [
        {
          title: '节点',
          align: "center",
          dataIndex: 'taskName'
        }
      ],
      url: {
        reCallTask: '/wf/task/reCallTask',
      }

    }
  },
  created() {
  },
  methods: {
    show() {
      this.visible = true
    },
    ok() {
      if (this.selectionRows.length <= 0) {
        this.$message.error("请选择撤回节点")
        return
      }
      let taskId = this.taskMsg.id
      let reCallTaskKey = this.selectedRowKeys[0]
      let param = {
        taskId: taskId,
        reCallTaskKey: reCallTaskKey
      }

      getAction(this.url.reCallTask, param).then(res => {
        if (res.succes) {
          this.$message.success(res.message)
          this.handleCancel()
        } else {
          this.$message.error(res.message)
        }
      })


    },
    cancel() {

    },
    handleCancel() {
      this.$emit('close');
      this.visible = false;
      this.dataInit()
    },
    dataInit() {
      this.selectionRows = []
      this.selectedRowKeys = []
    }
  }
}
